import React from "react";
import "./WorkDisplayTemplate.css";
import extend from "../images/extend-png-4.png";

function WorkDisplayTemplate() {
  function cl() {
    console.log("mükszik");
  }
  return (
    <>
      <div className="WorkDisplayTemplateContainer">
        <div className="WorkInformations">
          <p className="position">beosztás</p>
          <button onClick={cl} className="resize">
            {/* <p className="square">&#9633;</p> */}
            <img className="square" src={extend}></img>
          </button>
        </div>
        <div className="workPlace">
          <p>munkahely</p>
        </div>
        <div className="WorkTime">
          <p className="periodOfTime">2020-2021</p>
        </div>
        <div className="WorkDescription">
          <p className="jobInfos">rövid leírás</p>
        </div>
      </div>
    </>
  );
}

export default WorkDisplayTemplate;
